import React from "react";

function Footer() {
  return (
    <>
      <br />
      <hr />
      <br />
      <br />
      <p className="footer">
        Thank you for your time, the API might take a few seconds loading the
        content.
      </p>
      <br />
      <br />
    </>
  );
}

export default Footer;
